import axios from 'axios';
import {useEffect} from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

export default function ApplyTutor(props) {
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);
    return <div className="wrapper">
        <div className="sidebar">
            <h2>Apply</h2>
            <ul>
                <li><a href="#uploadPhoto">Upload photo</a></li>
                <li><a href="#personalInformation">Personal information</a></li>
                <li><a href="#subjects">Subjects</a></li>
                <li><a href="#education">Education</a></li>
                <li><a href="#experience">Experience</a></li>
                <li><a href="#policyAgreement">Policy Agreement</a></li>
            </ul>
        </div>
        <div className="content">
        <div className="box">
                <a name="removeTutor"></a>
                <div className="box_top">
                    <h2>Upload photo</h2>
                </div>
                <div className="box_bottom">

                </div>
            </div>
        </div>
        
    </div>
}
